import { IonApp, IonContent, IonIcon, IonItem, IonLabel, IonList, IonListHeader, IonMenu, IonMenuToggle, IonNote, IonRouterOutlet, IonSplitPane } from '@ionic/vue';
import { defineComponent, ref } from 'vue';
import { useRoute } from 'vue-router';
import { archiveOutline, archiveSharp, bookmarkOutline, bookmarkSharp, heartOutline, heartSharp, mailOutline, mailSharp, paperPlaneOutline, paperPlaneSharp, trashOutline, trashSharp, warningOutline, warningSharp } from 'ionicons/icons';

export default defineComponent({
        name: 'App',
        components: {
        IonApp, 
        IonContent, 
        IonIcon, 
        IonItem, 
        IonLabel, 
        IonList, 
        IonListHeader, 
        IonMenu, 
        IonMenuToggle, 
        IonNote, 
        IonRouterOutlet, 
        IonSplitPane,
        },
        setup() 
        {
                const selectedIndex = ref(0);
                const appPages = 
                [
                        {
                                title: 'Demo',
                                url: '/folder/Demo',
                                iosIcon: bookmarkOutline,
                                mdIcon: bookmarkSharp
                        },
                        {
                                title: 'Simple Playback',
                                url: '/folder/Simple Playback',
                                iosIcon: bookmarkOutline,
                                mdIcon: bookmarkSharp
                        },
                        {
                                title: 'Simple Recorder',
                                url: '/folder/Simple Recorder',
                                iosIcon: bookmarkOutline,
                                mdIcon: bookmarkSharp
                        },
                        {
                                title: 'Play from Mic',
                                url: '/folder/Play from Mic',
                                iosIcon: bookmarkOutline,
                                mdIcon: bookmarkSharp
                        },
                        {
                                title: 'Multi Playbacks',
                                url: '/folder/Multi Playbacks',
                                iosIcon: bookmarkOutline,
                                mdIcon: bookmarkSharp
                        },
                        {
                                title: 'Sound Effects',
                                url: '/folder/Spam',
                                iosIcon: bookmarkOutline,
                                mdIcon: bookmarkSharp
                        },
                        {
                                title: 'Set Log Level',
                                url: '/folder/Set Log Level',
                                iosIcon: bookmarkOutline,
                                mdIcon: bookmarkSharp
                        }

                ];

                const path = window.location.pathname.split('folder/')[1];
                if (path !== undefined) 
                {
                        selectedIndex.value = appPages.findIndex(page => page.title.toLowerCase() === path.toLowerCase());
                }

                const route = useRoute();

                return { 
                        selectedIndex,
                        appPages, 
                        archiveOutline, 
                        archiveSharp, 
                        bookmarkOutline, 
                        bookmarkSharp, 
                        heartOutline, 
                        heartSharp, 
                        mailOutline, 
                        mailSharp, 
                        paperPlaneOutline, 
                        paperPlaneSharp, 
                        trashOutline, 
                        trashSharp, 
                        warningOutline, 
                        warningSharp,
                        isSelected: (url: string) => url === route.path ? 'selected' : ''
                }
        }
});
